package dl;import java.util.List;public class Player implements Comparable<Player>{    List<String> words;    Integer points;    public List<String> getWords() {        return words;    }    public void setWords(List<String> words) {        this.words = words;    }    public Integer getPoints() {        return points;    }    public void setPoints(Integer points) {        this.points = points;    }    public void setPoints(int points){        this.points = points;    }    public int compareTo(Player player) {        return this.points.compareTo(player.points);    }}